initial_sparql:
SELECT ?protein ?begin ?end
WHERE
{
    ?protein a up:Protein ;
            up:annotation ?annotation .
    ?annotation a up:Transmembrane_Annotation ;
               up:range ?range .
    ?range faldo:begin [ faldo:position ?begin ] ;
           faldo:end [ faldo:position ?end ] .
}

improved_sparql:
SELECT ?protein ?begin ?end
WHERE
{
    ?protein a up:Protein ;
            up:annotation ?annotation .
    ?annotation a up:Transmembrane_Annotation ;
               up:range ?range .
    ?range faldo:begin [ faldo:position ?begin ] ;
           faldo:end [ faldo:position ?end ] .
}
ORDER BY ?protein ?begin
LIMIT 10
